var MatchvsLog = {
    toArray: function (argument) {
        var args = [];
        for (var i = 0; i < argument.length; i++) {
            args.push(argument[i]);
        }
        return args;
    }
};

function getNowFormatDate() {
    var date = new Date();
    var ___ = "-";
    var __ = ":";
    var month = date.getMonth() + 1;
    var strDate = date.getDate();
    if (month >= 1 && month <= 9) {
        month = "0" + month;
    }
    if (strDate >= 0 && strDate <= 9) {
        strDate = "0" + strDate;
    }
    return "[" + date.getFullYear() + ___ + month
        + ___ + strDate + " " + date.getHours() + __
        + date.getMinutes() + __ + date.getSeconds() + "."
        + date.getMilliseconds() + "]";
}

MatchvsLog.openLog = function (isDebug) {
    console.log("---- open log ----",isDebug?"(isDebug=true)":"(isDebug=false)");
    isDebug&&(MVS.DEBUG = true);
    if (typeof (wx) === "undefined") {
        MatchvsLog.logI = console.info.bind(console
            , "[INFO][Matchvs] ");
        MatchvsLog.logE = console.error.bind(console
            , "[ERROR][Matchvs] ");
        if (MVS.DEBUG) {
            MatchvsLog.logD = console.log.bind(console
                , "[DEBUG][Matchvs] ");
        } else {
            MatchvsLog.logD = function () {
            };
        }

    } else {
        MatchvsLog.logI = function () {
            var loc = "";
            try {
                throw new Error();
            } catch (e) {
                var line = e.stack.split(/\n/)[1];
                loc = line.slice(line.lastIndexOf("/") + 1, line.lastIndexOf(")"));
            }
            console.info("[INFO][Matchvs] " + getNowFormatDate() + " " + this.toArray(arguments) + " " + loc);
        };
        if (MVS.DEBUG) {
            MatchvsLog.logD = function () {
                var loc = "";
                try {
                    throw new Error();
                } catch (e) {
                    var line = e.stack.split(/\n/)[1];
                    loc = line.slice(line.lastIndexOf("/") + 1, line.lastIndexOf(")"));
                }
                console.log("[DEBUG][Matchvs] " + getNowFormatDate() + " " + this.toArray(arguments) + " " + loc);
            };
        } else {
            MatchvsLog.logD = function () {
            };
        }


        MatchvsLog.logE = function () {
            var loc = "";
            try {
                throw new Error();
            } catch (e) {
                var line = e.stack.split(/\n/)[1];
                loc = line.slice(line.lastIndexOf("/") + 1, line.lastIndexOf(")"));
            }
            console.error("[ERROR][Matchvs] " + getNowFormatDate() + " " + this.toArray(arguments) + " " + loc);
        };
    }
};

MatchvsLog.closeLog = function () {
    console.log("---- close log ----");
    MatchvsLog.logI = function () {
    };
    MatchvsLog.logE = function () {
    };
    MatchvsLog.logD = function () {
    };
};

MatchvsLog.openLog();//default, the log is opening

/* ================ mvsconfig.js ================= */
(function (mvs) {
    var STATE_EM = {
        NONE:             0x0000,     //无状态
        INITING :         0x0001,     //正在初始化
        HAVE_INIT :       0x0002,     //初始化
        LOGINING:         0x0004,     //正在登录
        HAVE_LOGIN :      0x0008,     //已登录
        IN_ROOM:          0x0010,     //在房间内
        CREATEROOM:       0x0020,     //创建房间中
        JOIN_ROOMING:     0x0040,     //加入房间中
        LEAVE_ROOMING:    0x0080,     //正在退出房间
        LOGOUTING:        0x0100,     //正在退出登录
        RECONNECTING:     0x0200,     //正在重新连接
        IN_WATCHING:      0x0400,     //正在加入观战
        IN_WATCH:         0x0800,     //在观战房间中
        LEAVE_WATCHING:   0x1000,     //在观战房间中
        TEAMMATCHING:     0x2000,     //正在组队匹配中
        IN_TEAM:          0x4000      //正在组队匹配中
    };
    mvs.ENGE_STATE = STATE_EM;

    function MvsState() {
        var state = STATE_EM.NONE;

        this.ReSet = function () {
            state = STATE_EM.NONE;
        };

        this.SetState = function (value) {
            state |= value;
        };

        this.DelState = function (value) {
            state &= ~value;
        };

        /**
         * 判断是否处于某个状态
         * @param {STATE_EM} value
         * @returns {boolean}
         * @constructor
         */
        var IsState = function (value) {
            return ((state & value) === value);
        };


        /**
         * 判断是否正在做某个操作
         * @returns {number}
         * @constructor
         */
        this.StateDoing = function () {
            if(IsState(STATE_EM.INITING)) return -3;
            if(IsState(STATE_EM.LOGINING)) return -5;
            if(IsState(STATE_EM.JOIN_ROOMING)) return -7;
            if(IsState(STATE_EM.CREATEROOM)) return -7;
            if(IsState(STATE_EM.LOGOUTING)) return -11;
            if(IsState(STATE_EM.IN_WATCHING)) return -12;    //正在加入观战
            if(IsState(STATE_EM.TEAMMATCHING)) return -13;   //真正匹配中
            if(IsState(STATE_EM.LEAVE_ROOMING)) return -10;  //正在离开房间
            if(IsState(STATE_EM.LEAVE_WATCHING)) return -14; //正在离开匹配
            return 0;
        };


        this.SetInit = function () {
            state = STATE_EM.NONE;
            this.SetState(STATE_EM.HAVE_INIT);
        };

        this.SetIniting = function () {
            state = STATE_EM.NONE;
            this.SetState(STATE_EM.INITING);
        };

        this.SetLogining = function () {
            this.DelState(STATE_EM.HAVE_LOGIN);
            this.SetState(STATE_EM.LOGINING);
        };

        this.SetLogin = function () {
            this.DelState(STATE_EM.LOGINING);
            this.SetState(STATE_EM.HAVE_LOGIN);
        };
        /**
         * 判断是否已经初始化
         * @returns {number}
         * @constructor
         */
        this.HaveInit = function () {
            if (IsState(STATE_EM.HAVE_INIT) === false) return -2;
            if (IsState(STATE_EM.INITING)) return -3;
            return 0;
        };
        /**
         * 判断是否已经登录 0 代表已经登录
         * @returns {number} 0 已经登录 -9 没登录
         * @constructor
         */
        this.HaveLogin = function () {
            var resNo = this.HaveInit();
            if (resNo !== 0)return resNo;
            if(!IsState(STATE_EM.HAVE_LOGIN)) return -4; //未登录
            return 0;
        };
        /**
         * 登录的时候状态监测
         * @returns {number}
         * @constructor
         */
        this.LoginCheck = function () {
            var resNo = this.StateDoing();
            if ( resNo < 0)return resNo;
            resNo = this.HaveInit();
            if ( resNo < 0)return resNo;
            if(IsState(STATE_EM.HAVE_LOGIN)) return -6; //已登录，未进入房间
            return 0;
        };

        this.changeNode = function () {
            var resNo = this.HaveLogin();
            if ( resNo < 0)return resNo;
            resNo = this.StateDoing();
            if ( resNo < 0)return resNo;
            if(IsState(STATE_EM.IN_TEAM))return -8;
            if(IsState(STATE_EM.IN_WATCH))return -8;
            if(IsState(STATE_EM.IN_ROOM))return -8;

            return 0;
        };

        this.SetJoinRooming = function () {
            this.SetState(STATE_EM.JOIN_ROOMING);
        };

        this.SetInRoom = function () {
            this.SetState(STATE_EM.IN_ROOM);
        };
        this.SetCreateRoom = function () {
            this.DelState(STATE_EM.IN_ROOM);
            this.SetState(STATE_EM.CREATEROOM);
        };
        this.DelCreateRoom = function () {
            this.DelState(STATE_EM.CREATEROOM);
        };
        /**
         *
         * @returns {boolean}
         * @constructor
         */
        this.IsCreateRoom = function () {
            return IsState(STATE_EM.CREATEROOM);
        };
        this.DelJoinRooming = function () {
            this.DelState(STATE_EM.JOIN_ROOMING);
        };
        /**
         *
         * @returns {boolean}
         * @constructor
         */
        this.IsJoinRooming = function () {
            return IsState(STATE_EM.JOIN_ROOMING);
        };

        this.DelInRoom = function () {
            this.DelState(STATE_EM.CREATEROOM);
            this.DelState(STATE_EM.JOIN_ROOMING);
            this.DelState(STATE_EM.IN_ROOM);
            this.DelState(STATE_EM.LEAVE_ROOMING);
            this.DelState(STATE_EM.LEAVE_WATCHING);
            this.DelState(STATE_EM.IN_WATCH);
            this.DelState(STATE_EM.IN_ROOM);
        };
        /**
         * 判断是否已经在房间里面
         * @returns {number}
         * @constructor
         */
        this.HaveInRoom = function () {
            var resNo = this.HaveLogin();
            if(resNo < 0)return resNo;
            resNo = this.StateDoing();
            if(resNo < 0) return resNo;
            if(!IsState(STATE_EM.IN_ROOM)) return -6; // 已登录，未进入房间
            return 0;
        };

        /**
         * 或创建加入房间的时候监测
         * @returns {*}
         * @constructor
         */
        this.InRoomCheck = function () {
            var resNo = this.HaveLogin();
            if(resNo < 0)return resNo;
            resNo = this.StateDoing();
            if(resNo < 0) return resNo;
            if(IsState(STATE_EM.IN_ROOM))return -8; //已经在房间
            if(IsState(STATE_EM.IN_WATCH)) return -8;//已经在观战房间
            return 0;
        };


        /**
         * 判断是否正在重新连接
         * @returns {number}
         * @constructor
         */
        this.IsReconnecting = function () {
            if(IsState(STATE_EM.RECONNECTING)) return -9;
            return 0;
        };

        /**
         *
         * @returns {number}
         * @constructor
         */
        this.ReconnectCheck = function () {
            var resNo = this.HaveInit();
            if(resNo < 0)return resNo;
            if(IsState(STATE_EM.RECONNECTING)) return -9;
            if(IsState(STATE_EM.IN_ROOM)) return -8;
            return 0;
        };

        /**
         * 设置为正在重连
         * @constructor
         */
        this.SetReconnecting = function () {
            this.SetState(STATE_EM.RECONNECTING);
        };
        /**
         * 清理正在重连
         * @constructor
         */
        this.DelReconnecting = function () {
            this.DelState(STATE_EM.RECONNECTING);
        };


        /**
         *
         * @returns {number}
         * @constructor
         */
        this.LeaveRoomCheck = function () {
            var resNo = this.HaveLogin();
            if(resNo < 0)return resNo;
            resNo = this.StateDoing();
            if(resNo < 0)return resNo;
            return 0;
        };

        this.SetLeaveRooming = function () {
            this.SetState(STATE_EM.LEAVE_ROOMING);
        };
        /**
         *
         * @returns {boolean}
         * @constructor
         */
        this.IsLeaveRooming = function () {
            return IsState(STATE_EM.LEAVE_ROOMING);
        };

        this.SetLoginOuting = function () {
            this.SetState(STATE_EM.LOGOUTING);
        };
        /**
         *
         * @returns {boolean}
         * @constructor
         */
        this.IsLoginOuting = function () {
            return IsState(STATE_EM.LOGOUTING);
        };

        this.SetJoinWatching = function () {
            this.SetState(STATE_EM.IN_WATCHING);//正在加入观战
        };
        this.DelJoinWatching = function () {
            this.DelState(STATE_EM.IN_WATCHING);//正在加入观战
        };

        this.SetInWatch = function () {
            this.SetState(STATE_EM.IN_WATCH);
        };
        /**
         *
         * @returns {number}
         * @constructor
         */
        this.HaveInWatch = function () {
            var resNo = this.HaveLogin();
            if(resNo !== 0) return resNo;
            resNo = this.StateDoing();
            if(resNo !== 0)return resNo;
            if(!IsState(STATE_EM.IN_WATCH)) return -6;
            return 0;
        };

        /**
         *
         * @returns {number}
         * @constructor
         */
        this.InWatchCheck = function () {
            var resNo = this.HaveLogin();
            if(resNo !== 0) return resNo;
            resNo = this.StateDoing();
            if(resNo !== 0)return resNo;
            if(IsState(STATE_EM.IN_WATCH)) return -8;
            return 0;
        };

        /**
         * 检测是否已经在小队中，不在小队中返回错误码
         * @returns {number}
         * @constructor
         */
        this.HaveInTeam = function () {
            var resNo = this.HaveLogin();
            if(resNo !== 0) return resNo;
            resNo = this.StateDoing();
            if(resNo !== 0)return resNo;
            if(!IsState(STATE_EM.IN_TEAM)) return -22;//不在小队中
            return 0;
        };

        this.SetInTeam = function () {
            this.SetState(STATE_EM.IN_TEAM);
        };

        this.DelInTeam = function () {
            this.DelState(STATE_EM.IN_TEAM);
        };

        this.SetTeamMatching = function () {
            this.SetState(STATE_EM.TEAMMATCHING);
        };

        this.DelTeamMatching = function () {
            this.DelState(STATE_EM.TEAMMATCHING);
        };
        /**
         *
         * @returns {boolean}
         * @constructor
         */
        this.IsTeamMatching = function () {
            return IsState(STATE_EM.TEAMMATCHING);
        };

    }

    mvs.MvsState = MvsState;

})(MVS || {});

